var app=angular.module("app",["ngRoute"]).run(function(e,l){e.$on("$viewContentLoaded",function(){l.removeAll()})}).config(function(e){e.when("/web",{templateUrl:"partials/web.html",controller:"webCtrl"}).when("/person/:id",{templateUrl:"partials/profile.html",controller:"profileCtrl"}).when("/school_overview",{templateUrl:"partials/school_overview.html",controller:"schoolProfileCtrl"}).when("/search",{templateUrl:"partials/search.html",controller:"searchCtrl"}).when("/search_result",{templateUrl:"partials/search_result.html"}).when("/news",{templateUrl:"partials/news.html",controller:"newsCtrl",resolve:{newsItem:function(){return"This is a news item produced by the resolve"}}})});